        @wraps(func)
        async def wrapper(self, *args, **kwargs):
            action_logger.info(f"[{action_name}] Started")
            console_handler.flush()
            try:
                result = await func(self, *args, **kwargs)
                action_logger.info(f"[{action_name}] Success - Result: {result}")

